CREATE VIEW [Agresso_RawTyped].[vrt_Huvudbok_01]ASSELECT [SysFileName] ,[SysDatetimeInsertedUTC] ,[SysDatetimeUpdatedUTC] ,[SysDatetimeDeletedUTC] ,[SysSrcGenerationDateTime] ,[SysModifiedUTC] ,[SysExecutionLog_key] ,[recno] ,[section] ,[Tab] ,[Account] ,[Client] ,[Lastupdate] ,[Vouchertype] ,[Voucherno] ,[Sequenceno] ,[Voucherdate] ,[PERIOD] ,[Dim1] ,[Dim2] ,[Dim3] ,[Dim4] ,[Dim5] ,[Dim6] ,[Dim7] ,[Taxcode] ,[Description] ,[Amount] ,[Currency] ,[Curamount] ,[Extinvref] ,[Aparid] ,[Apartype] ,[Att1id] ,[Att2id] ,[Att3id] ,[Att4id] ,[Att5id] ,[Att6id] ,[Att7id]  FROM    (SELECT * , _isFirst = LAG(0,1,1) OVER (PARTITION BY [Client] , [Voucherno] , [Sequenceno]  ORDER BY [SysSrcGenerationDateTime] DESC)  FROM [Agresso_RawTyped].[rt_Huvudbok_01]) t WHERE t._isFirst = 1